import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";

export default function Priest() {
  return (
    <div>
      <Navbar />
      <div class="mt-10 ml-10 max-w-5xl p-2 bg-white border border-gray-200 rounded-lg shadow dark:bg-gray-800 dark:border-gray-700">
        <a href="#">
          <h5 class="mb-2 text-1xl font-bold tracking-tight text-gray-900 dark:text-white">Priest Sri Keshava Kaidala Sampath Kumar</h5>
        </a>
        <ul class="max-w-md space-y-1 text-gray-500 list-disc list-inside dark:text-gray-400">
          <li class="inline-block">Priest Sri Keshava Kaidala Sampath Kumar joined Omkaar temple on January 1st, 2021.</li>
          <li class="inline-block ml-2">Priest Keshava is fluent in Telugu, Hindi, and English.</li>
        </ul>
      </div>

      <Footer />
    </div>
  )
}
